var $bm_rt;
var vT, tR, r;
try {
    vT = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Position XY');
    tR = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Transform Random');
    r = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Random Seed');
    seedRandom(mul(r, index), true);
    $bm_rt = sum(sum(vT, random($bm_neg(tR), tR)), value);
} catch (e) {
    $bm_rt = value;
}

var $bm_rt;
var p, amp, freq, offset, decay, decayStart, sin, noiser;
try {
    p = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Velocity Transform').valueAtTime(mul(comp('Comp 2').frameDuration, index));
    amp = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Amplitude Ran').valueAtTime(mul(comp('Comp 2').frameDuration, index));
    freq = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Frequency Ran').valueAtTime(mul(comp('Comp 2').frameDuration, index));
    offset = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Offseter').valueAtTime(mul(comp('Comp 2').frameDuration, index));
    decay = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Decay Ran').valueAtTime(mul(comp('Comp 2').frameDuration, index));
    decayStart = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Decay Linear').valueAtTime(sub(time, startTime));
    sin = mul(div(mul(Math.sin(sum(mul(mul(mul(sub(time, startTime), freq), Math.PI), 2), offset)), amp), Math.exp(mul(sub(time, startTime), decay))), decayStart);
    noiser = comp('Comp 2').layer('SOMA').effect('Super Liquids')('Noiser').valueAtTime(sum(time, index));
    $bm_rt = sum(sum([
        value[0] - p[0] * (-time + startTime),
        value[1] + sin
    ], [
        p[1],
        p[2]
    ]), noiser);
} catch (e) {
    $bm_rt = value;
}

